import React from 'react';



class Game extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
           userDice1: 1,
           userDice2: 5,
           enemyDice1: 4,
           enemyDice2: 6

            };
        }




    render(){

        let userValue = this.state.userDice1 + this.state.userDice2;
        let enemyValue = this.state.enemyDice1 + this.state.enemyDice2;


        return(
            <div className="game-screen">
                <div className='container'>
                    <div className='dice-container'>

                    </div>
                    <h1> user : {userValue} </h1>
                    <h1> CPU : {enemyValue}</h1>
                    <button>Roll</button>
                </div>
            </div>
        );
    }
}


export default Game;
